Открытый, анонимный, торрент-трекер без учёта рейтинга  www.rus-media.org

Преимущества нового трекера:

1. Возможность скачивать без регистрации
2. Полная анонимность
3. Более 6 Тb самых новых фильмов, игр, сериалов, мультиков и не только;
4. Отменён рейтинг, качайте сколько хотите;
5. Высокая скорость скачивания (до 100 мбит/с);
6. Открылся раздел Pron (порно);
7. Возможность скачивания без сидов и пиров;
8. Возможность создавать релизы и не стоять на раздаче (мультитрекерные релизы);
9. Красивый и чёткий дизайн трекера;
10. Стабильная работа трекера.

Заходите к нам на трекер и качайте без ограничений!!! Будем рады всем!
